class L394_IsSubsequence
{
    /**
     * @param String $s
     * @param String $t
     * @return Boolean
     */
    function isSubsequence($s, $t) {
        if(empty($s)){
            return true;
        }
        $sArr = str_split($s);

        $p = -1;
        foreach($sArr as $v){
            $cp = strpos($t,$v,$p + 1);
            if($cp === false || ($cp <= $p)){
                return false;
            }
            $p = $cp;
        }

        return true;
    }
}

$s = 'leeeeetcode';
$t = '';

$m = new L394_IsSubsequence();
var_dump($m->isSubsequence($s,$t));
